import React from 'react'

//Bootstrap
import Container from "react-bootstrap/Container";

function Stats(props) {
    console.log(props.country[0])

    return (
        <div className='stats'>
            <Container>
                <h2>{props.country[0].country}</h2>
                <h4>{props.country[0].province}</h4>
                <p>{props.country[0].latest}</p>
                <p className='death-no-animation'>{props.country[1].latest}</p>
                <p className='recovered-no-animation'>{props.country[2].latest}</p>
                <hr/>
            </Container>
        </div>
    )
}

export default  Stats
